import React from 'react';
import './Contact.css';

function Contact(props) {
	return (
		<div className='contact-page-container'>
			<a className='social'>

					<img className='social-icon' src={require('../../assets/Gmail.png')} alt='' />

			</a>
			<a className='social'>

					<img className='social-icon' src={require('../../assets/GitHub-logo.png')} alt='' />

			</a>
			<a className='social'>



					<img className='social-icon' src={require('../../assets/LinkedIn-logo.png')} alt='' />

			</a>
		</div>
	);
}

export default Contact;
